  true,\n\t\"url\": null,\n\t\"notes\": \"HEPGIS is a web-based interactive geographic
  map server that allows users to navigate and view geo-spatial data, print maps,
  and obtain data on specific features using only a web browser.  It includes geo-spatial
  data used for transportation planning. HEPGIS previously received ARRA funding for
  development of Economically distressed Area maps. It is also being used to demonstrate
  emerging trends to address MPO and statewide planning  regulations/requirements
  , enhanced National Highway System,  Primary Freight Networks, commodity flows and
  safety data . HEPGIS has been used to help implement MAP-21 regulations and will
  help implement the Grow America Act, particularly related to Ladder of Opportunities
  and MPO reforms.\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\":
